import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Link,
    Routes,
    Route
}   from 'react-router-dom';

import Blog from './Blog/BlogPage';
import Projects from './ClassProjects/ClassProps';
import EventReact from './ReactEvent/Activity01-Event';

class App extends Component {
    render(){
        return(
            <Router>
                <div>
                    <h1>React Router</h1>
                    <ul>
                        <li>
                            <Link to="/myblog">Blog</Link>
                        </li>
                        <li>
                            <Link to="/myprops">Class Props</Link>
                        </li>
                        <li>
                            <Link to="/myevents">React Event</Link>
                        </li>
                    </ul>
                    <Routes>
                        <Route
                        exact
                        path="/myblog"
                        element={<Blogs/>}
                        ></Route>
                        <Route
                        exact
                        path="/myprops"
                        element={<PropsAct/>}
                        ></Route>
                        <Route
                        exact
                        path="/myevent"
                        element={<EventAct/>}
                        ></Route>
                    </Routes>
                </div>
            </Router>
        )
    }
}

export default App;
